import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser } from '@fortawesome/free-solid-svg-icons';
import "./navbar.css";

const Navbar = () => {
    return (

        <div className="nav">
            <div className="nav-bar"><h6 >Connect<br></br>Distribution</h6>
            </div>
            <details>
                <summary><FontAwesomeIcon icon={faUser} className="prime" />PrimeCare Pharma</summary>
                <p>Change Password</p>
                <p>LogOut</p>
            </details>

        </div>

    );
};

export default Navbar;
